import React,{Component} from 'react';

class Any extends Component{
    constructor(){
        super();
        this.state={
        count :0
        }
    }
    changeMes(){
        
        this.setState(
            {
                count:this.state.count+1
            } ,()=>console.log(this.state.count))
           
        
    }
    render(){
        return (
            <div >
        <h1>{this.state.count}</h1>
        <button type="button" onClick={()=>this.changeMes()}  name="" id="">click</button>
        </div>
        )
    }       
}export default Any
